import React from "react";
import css from "@emotion/css";
import TopHeader from "./topHeader";
import PageTitle from "./pageTitle";

const Header = () => {
  return (
    <React.Fragment>
      <div className="bg-black  block text-white py-4 px-4">
        <TopHeader />
      </div>
    </React.Fragment>
  );
};

export default Header;
